import classes from "./jobanalyticslist.module.css";

function JobAnalyticsListPage({ icon, label, number }) {
  return (
    <li>
      <span className={classes.analytics_list}>
        <p>{icon} </p>
        <p className={classes.analytics_label}>{label}</p>
        <p
          className={`${classes.number_gap} ${classes.analytics_label__number}`}
        >
          {number}
        </p>
      </span>
    </li>
  );
}

export default JobAnalyticsListPage;
